import React from 'react';
import Movie from './Movie';
import '../css/App.css'

function MovieList(props) {
    return (
        props.movies.map(movie =>{
            return <>
                <div className="row">
                    <Movie key={movie.id} movie={movie}/>
                </div>
            </>
        })
    )
}

export default MovieList
